function procesandoResultadoLista(result) {
  for (var i = 0; i < result.length; i++) {
    result[i].archivo = "<span class=\"font-weight-bold\">".concat(result[i].archivo, "</span>");

    if (result[i].time_sum == "No disponible") {
      result[i].archivo_sum = "<span class=\"font-weight-bold\" style=\"color:red\">".concat(result[i].archivo_sum, "</span>");
    } else {
      result[i].archivo_sum = "<div>\n                        <a href=\"javascript:void(0)\" data-uno=\"".concat(result[i].archivo_sum, "\"\n                        class=\"shadow-sm font-weight-bold downloadCmts\" alt=\"Cmts Sum\" title=\"Cmts Sum\">\n                                ").concat(result[i].archivo_sum, "\n                        </a></div>");
    }

    result[i].time_sum = "<span class=\"font-weight-bold\">".concat(result[i].time_sum, "</span>");

    if (result[i].time_phy == "No disponible") {
      result[i].archivo_phy = "<span class=\"font-weight-bold\" style=\"color:red\">".concat(result[i].archivo_phy, "</span>");
    } else {
      result[i].archivo_phy = "<div>\n                        <a href=\"javascript:void(0)\" data-uno=\"".concat(result[i].archivo_phy, "\"\n                        class=\"shadow-sm font-weight-bold downloadCmts\" alt=\"Cmts Sum\" title=\"Cmts Sum\">\n                                ").concat(result[i].archivo_phy, "\n                        </a></div>");
    }

    result[i].time_phy = "<span class=\"font-weight-bold\">".concat(result[i].time_phy, "</span>");

    if (result[i].time_scm == "No disponible") {
      result[i].archivo_scm = "<span class=\"font-weight-bold\" style=\"color:red\">".concat(result[i].archivo_scm, "</span>");
    } else {
      result[i].archivo_scm = "<div>\n                        <a href=\"javascript:void(0)\" data-uno=\"".concat(result[i].archivo_scm, "\"\n                        class=\"shadow-sm font-weight-bold downloadCmts\" alt=\"Cmts Sum\" title=\"Cmts Sum\">\n                                ").concat(result[i].archivo_scm, "\n                        </a></div>");
    }

    result[i].time_scm = "<span class=\"font-weight-bold\">".concat(result[i].time_scm, "</span>");
  }

  return result;
}

